import './index.css';

var top10 = [
  ["Hinckley Train Station", "4754", "2274"],
  ["London City", "5000", "1000"]
],

test1 = [],
test2 = [],

i;

for (i = 0; i < top10.length; i++){
  test1.push([top10[i][0], top10[i][1]]);
  test2.push([top10[i][0], top10[i][2]]);
}

console.log(test1);
